import React from "react";
import RecipeCard from "./RecipeCard"


const RecipeList = ({recipes, addToFavorite}) => {
  const showRecipes = () => recipes.map((recipe, i) => <RecipeCard key={i} recipe={recipe} addToFavorite={addToFavorite}/>)
  // console.log(recipes)
  return (
    <div className="recipe-list">
     {showRecipes()}
    </div>
  );
};

export default RecipeList;
